import React, { Component } from "react";
import {  MDBBtn, 
          MDBCol, 
          MDBContainer, 
          MDBRow, 
          MDBIcon, 
          MDBCard,
          MDBCardTitle,
          MDBCardBody,
          MDBCardImage,
          MDBCardText
        } from "mdbreact";
import "./index.css";
import logo from "./logo.png";

class App extends React.Component {
   render() {
      return (
         <div>
            <Header/>
            <Content/>
         </div>
      );
   }
}
class Header extends React.Component {
   render() {
      return (
         <div>
            <div className="bg container">
              <MDBContainer>
                <MDBRow>
                  <MDBCol align="right" className="mt-4">
                      <a href="#" className="pr-3" >Masuk</a> 
                      <MDBBtn outline color="white" href="#">Daftar</MDBBtn>
                  </MDBCol>
                </MDBRow>
                <MDBRow>
                  <MDBCol> 
                    <p>Temukan restoran, kafe, dan bar terbaik</p> 
                  </MDBCol>
                </MDBRow>
                <MDBRow>
                  <MDBCol md="6" className="mt-5 pt-5">
                    <form className="form-inline mt-4 mb-4">
                      <MDBIcon icon="search" />
                      <input className="form-control form-control-sm ml-3 w-75" type="text" placeholder="Search" aria-label="Search" />
                    </form>
                  </MDBCol>
                </MDBRow>
              </MDBContainer>
            </div>
         </div>
      );
   }
}
class Content extends React.Component {
   render() {
      return (
        <MDBRow className="">

        </MDBRow>
      );
   }
}
export default App;
